Chat Edit: 'Yo so my webapp stores the key at the end as a parameter and validates the key with:
  <!-- Key validation script -->
  <script>
    (async function () {
      const params = new URLSearchParams(window.location.search);
      const key = params.get("key");
      if (!key) {
        window.location.href = "login.html";
        return;
      }
      try {
        const res = await fetch("/api/auth.js", {
          method: "POST",
          headers: { "Content-Type": "application/json" },
          body: JSON.stringify({ key }),
        });
        const data = await res.json();
        if (!data.success) {
          window.location.href = "login.html";
        }
      } catch (e) {
        window.location.href = "login.html";
      }
    })();
  </script>

  But there is an issue, when you quickly switch between tabs it kicks you to login'
